import * as React from 'react';

import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import './AddMedical.css';

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};

//התרופות
export const AddMedical = () => {
    
    //הוספת תרופה
    // const addNewUMadicines=async(e)=> {
    //     debugger
    //         e.preventDefault();
    //     let newM ={
    //         name:e.target.name.value,
    //     }
    //     let NewMadicinesList = await addMedicines(newM)

    //     console.log( NewMadicinesList)
    const allMedical = [
        "אקמול", "דקסמול", "נורופן"
    ]

    return <>
        <Modal
            open={open}
            onClose={handleClose}
            aria-labelledby="modal-modal-title"
            aria-describedby="modal-modal-description"
        >
            <Box sx={style}>
                <Typography id="modal-modal-title" variant="h6" component="h2">
                    הוספת תרופה
                </Typography>
                <Typography id="modal-modal-description" sx={{ mt: 2 }}>
                    <form onSubmit={(e) => addNewUMadicines(e)}>

                        <Autocomplete
                            className='myautocomplate'
                            disablePortal
                            id="medicalName"
                            options={allMedical}
                            sx={{ width: 300 }}
                            renderInput={(params) => <TextField {...params} label="" />}
                        />

                    </form>

                    <button type='button' style={{ height: "30px", width: "70px", color: "green" }}>תרופה</button>


                </Typography>
            </Box>
        </Modal>

    </>
}
export default AddMedical;
